window.bookSummaryJSON = "<p><b>Infinite power at your fingertips and a target on your back.</b></p> <p>Anya Nowicki, along with thousands of people around the globe, has found herself a host for alien technology known as the Archive.</p> <p>The Archive allows its hosts to alter their minds and bodies in an instant through holographic menu systems. With the touch of a button, anyone can become super strong, gain magical abilities, purchase a giant robot, or become a master in an almost infinite number of skills ranging from advanced combat techniques to fidget-spinning.</p> <p>However, Anya has also become the target for nightmarish, shape-shifting creatures that have come to Earth following the newfound extraterrestrial tech. The Archive can grant their hosts great power, but it may not be enough to survive the horde of murderous aliens hunting them down.</p> <p><i>Homicidal Aliens Are Invading and All I Got Is This Stat Menu </i>contains strong language and graphic violence.</p>"; 
